import styled from "styled-components";

// Material UI
import { Grid } from "@material-ui/core";

export const CollectionsOverviewContainer = styled(Grid)`
  display: flex;
  justify-content: center;
  background-color: white;
  flex-wrap: wrap;
  z-index: 123;
  // border: black solid 5px;
  border-radius: 25px;
  padding: 33px;
  margin-left: 11vw;
  margin-right: 11vw;
  margin-top: -33vh;
  margin-bottom: 66px;
`;
